import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './styles/about.less';
import '../global/global.less';
import meSvg from './img/me.svg';
import dogSvg from './img/dog.svg';
import cookieSvg from './img/cookie.svg';
import engineerSvg from './img/engineer.svg';
import bulletJournalSvg from './img/bulletjournal.svg';

class About extends Component {
  render() {
    return (
      <div className="about">
          <img className="about-me" src={meSvg} />
          <div className="about-bar"></div>
          <div className="about-icons">
            <img className="about-icon" src={engineerSvg} />
            <img className="about-icon cookie" src={cookieSvg} />
            <img className="about-icon" src={dogSvg} />
            <img className="about-icon" src={bulletJournalSvg} />
          </div>
          <div className="about-title">
            <div className="about-icon">software engineer</div>
            <div className="about-icon cookie">small business owner</div>
            <div className="about-icon">dog momma</div>
            <div className="about-icon">bullet journaler</div>
          </div>
      </div>
    );
  }
}

export default About;
